import LeftPane from "../LeftPane/LeftPane";
import RightPane from "../RightPane/Rightpane";
import "./Dashboard.css";

const Dashboard = () =>{
    let navigationListItems =
    [ 
    {
        name: "Home",
        message: 0,
    },
    {
        name: "Facturen",
        message: 0,
    },
    {
        name: "Bestellingen",
        message: 1,
    },
    {
        name: "Retour",
        message: 1,
    },
    {
        name: "Contact",
        message: 2,
    },
    ]
    return (<article className="dashboard">
        <LeftPane  navigationListItems={navigationListItems}/>
        <RightPane />
    </article>
    );
}
export default Dashboard
